import React from "react";
import "./style.css";
import {Container, Row, Col} from "./components/Grid";

function Card(props) {
    return (
        <Container>
        <div className="card">
            <div><img alt={props.last} src={props.image}></img></div>
            <div>{props.first} {props.last} </div>
            <div>{props.gender}</div>
            <div>{props.age}</div>
            <div>{props.email}</div>
            <div>{props.phone}</div>
        </div>
        </Container>
    );
}

export default Card;
